import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import Button from 'muicss/lib/react/button';

import fire from './config/Fire.js';
import nav from './nav.js';
class Example extends React.Component {
    render() {
      return (
        <div>
          <div>
            <Button>button</Button>
            <Button color="primary">button</Button>
            <Button color="danger">button</Button>
            <Button color="accent">button</Button>
          </div>
          <div>
            <Button disabled={true}>button</Button>
            <Button color="primary" disabled={true}>button</Button>
            <Button color="danger" disabled={true}>button</Button>
            <Button color="accent" disabled={true}>button</Button>
          </div>
        </div>
      );
    }
  }

  ReactDOM.render(<Example />, document.getElementById('example'));
class Home extends Component {
    constructor(props) {
        super(props);
        this.logout = this.logout.bind(this);
    }


    logout() {
        fire.auth().signOut();
    }


    render() {

        return (
            <div>
            <button style={{textAlign: "inherit"}} type="submit" onClick={this.logout} class="btn btn-primary">Logout</button>

            <h1 style={{textAlign: "center"}}>Hellow World.</h1>

            <row><button style={{textAlign: "inherit"}} type="submit" onClick={this.logout} class="btn btn-primary">Customers</button></row>

            <row><button style={{textAlign: "inherit"}} type="submit" onClick={this.logout} class="btn btn-primary">Order Entry</button></row>

            <button style={{textAlign: "inherit"}} type="submit" onClick={this.logout} class="btn btn-primary">Logout</button>
            <button style={{textAlign: "inherit"}} type="submit" onClick={this.logout} class="btn btn-primary">Logout</button>

            </div>
        );
    }
    }

    export default Example;
